import { FormGroup, FormControl, Validators } from '@angular/forms';
import * as i0 from "@angular/core";
import * as i1 from "@angular/forms";
export class AddEditStudentsComponent {
    constructor() {
        this.studentUpdateForm = new FormGroup({
            firstName: new FormControl(null, Validators.required),
            lastName: new FormControl(null, Validators.required),
            email: new FormControl(null, [Validators.required, Validators.email]),
            regNumber: new FormControl(null, Validators.required),
            grade: new FormControl(null)
        });
    }
    ngOnInit() {
    }
    onStudentFormSubmit() {
        if (this.studentUpdateForm.valid) {
            var studentAttributes = {
                regNumber: this.studentUpdateForm.value.regNumber,
                grade: this.studentUpdateForm.value.grade
            };
            var student = {
                firstName: this.studentUpdateForm.value.firstName,
                lastName: this.studentUpdateForm.value.lastName,
                email: this.studentUpdateForm.value.email,
                attributes: studentAttributes
            };
            this.studentService.createStudent(student).subscribe({
                next: async (response) => {
                    this.clearStudentCreationForm();
                    this.showAlertMessage("User created successfully!!!", true);
                },
                error: (error) => {
                    this.clearStudentCreationForm();
                    this.showAlertMessage("An error occurred while the user is created!!!", false);
                }
            });
        }
        else {
            console.log(this.studentUpdateForm.errors);
        }
    }
}
